import './App.css';

function App() {

    const users = [
        {name: 'user1', surn: 'surn1', age: 30},
        {name: 'user2', surn: 'surn2', age: 31},
        {name: 'user3', surn: 'surn3', age: 32},
    ];

    const map = users.map ((elem, index) => <li key = {index}>{elem.name}  {elem.surn}  {elem.age}</li>)

    return <ul>
        {map}
    </ul>
}

export default App;
